import ExpenseItem from './ExpenseItem';

function ExpenseList(props) {

  return (
    props.expenses.forEach( exp => {
      <ExpenseItem 
        title={exp.title}
        amount={exp.amount}
        date={exp.date}
      />
    })
  ); 
}


export default ExpenseList;
